    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block styles %}{{ encore_entry_link_tags('login') }}{% endblock %}

{% block body %}
<form id=\"formulaire\" method=\"post\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {% if app.user %}
        <div class=\"mb-3\">
            You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
        </div>
    {% endif %}

    <h1 class=\"h3 mb-3 font-weight-normal\">Please sign in</h1>
    <label class=\"label_login1\" for=\"inputEmail\">Email</label>
    <input type=\"email\" placeholder=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" required autofocus>
    <label class=\"label_login2\" for=\"inputPassword\">Password</label>
    <input type=\"password\" placeholder=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" required>

    <input type=\"hidden\" name=\"_csrf_token\"
           value=\"{{ csrf_token('authenticate') }}\"
    >

    {#
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}

    <button class=\"btn btn-lg btn-primary\" id=\"btn_login\" type=\"submit\">
        Sign in
    </button>
</form>
{% endblock %}

{% block javascripts %}{{ encore_entry_script_tags('login') }}{% endblock %}
", "security/login.html.twig", "D:\\wamp64\\www\\EcoProject\\ecoView\\templates\\security\\login.html.twig");
